import logo from "../img/logo.png";
import Card from "./Card";
const names = [{name:'James'},{name:'Paul'},{name:'John'},{name:'George'},{name:'Ringo'}];
const CardContainer = ()=>{
    return (
        <>
            <div className="container-fluid">
                <div className="row">
                    {
                        names.map(obj=>(<Card val={obj}/>))
                    }
                </div>

            </div>
        </>
    );
}

export default CardContainer;
